import React, { useState, useRef } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import axios from "axios";
import "react-calendar/dist/Calendar.css";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

import CardContent from "@material-ui/core/CardContent";

import Typography from "@material-ui/core/Typography";
import { useSelector } from "react-redux";

const useStyles = makeStyles({
  root: {
    minWidth: 275,
    maxWidth: 1000,
    minHeight: 400,
  },

  title: {
    fontSize: 30,
    fontWeight: "bold",
    paddingLeft: 180,
  },

  pos: {
    marginBottom: 12,
  },
  span: {
    paddingLeft: 100,
  },
  note: {
    color: "red",
  },
});

function BookingScreen(props) {
  const classes = useStyles();
  const [name, setName] = useState("");
  const [user, setuser] = useState("");

  const [mobilenumber, setMobilenumber] = useState("");
  const [photoidproof, setphotoidproof] = useState("");
  const [idproofnumber, setIdproofnumber] = useState("");
  const [birthdate, setBirthdate] = useState("");
  const [age, setAge] = useState("");
  const [sideinfo, setsideinfo] = useState("");

  const [hoslocation, setHoslocation] = useState("");
  const [dateinfo, setdateinfo] = useState(new Date());
  const [timeinfo, settimeinfo] = useState("");

  const userSignin = useSelector((state) => state.userSignin);
  const { userInfo } = userSignin;
  console.log(userInfo._id);

  const submitHandler = async (e) => {
    e.preventDefault();

    const data = {
      name,
      mobilenumber,
      birthdate,
      age,
      user,
      photoidproof,
      idproofnumber,
      sideinfo,
      hoslocation,
      dateinfo,
      timeinfo,
    };
    try {
      const resp = await axios.post(
        "http://localhost:5000/api/booking/sendmsg",
        data
      );

      const bookingID = resp.data._id;
      props.history.push(`/printbooking/` + bookingID);
      console.log(resp.data);
    } catch (err) {
      // Handle Error Here
      console.error(err);
    }
  };
  // const sendPostRequest = async () => {

  // }
  // sendPostRequest();
  // const bookingID;
  // axios
  //   .post("http://localhost:5000/api/booking/sendmsg", data)
  //   .then((res) => {
  //     setresponsedata(res);
  //     const bookingID = 64654;
  //     props.history.push(`/printbooking/` + bookingID);
  //     // axios.get("http://localhost:5000/api/booking/pdf", {
  //     //   responseType: "blob",
  //     // });
  //   })
  //   .catch((err) => {
  //     console.log("Error in CreateBook!");
  //   });

  return (
    <div className="form-topview">
      <div className="form-maindiv">
        <Card className={classes.root}>
          <CardContent>
            <Typography
              className={classes.title}
              color="textSecondary"
              gutterBottom
            >
              Register For Vaccination
            </Typography>

            <div className="form-midview">
              <p className="pnote">
                <span className={classes.note}>Note: </span> Your Photo ID will
                be verified at the time of your vaccination appointment. Please
                provide the details <br />
                <span className={classes.span}>
                  of the Photo ID you will carry for vaccination.Otherwise you
                  will not be eligible for vaccination.
                </span>
              </p>

              <form className="form" onSubmit={submitHandler}>
                <input
                  type="text"
                  id="name"
                  required
                  value={userInfo._id}
                  onChange={(e) => setuser(userInfo._id)}
                ></input>
                <div>
                  <label htmlFor="name">Name</label>
                  <input
                    type="text"
                    id="name"
                    value={name}
                    placeholder="Enter name"
                    required
                    onChange={(e) => setName(e.target.value)}
                  ></input>
                </div>
                <div>
                  <label htmlFor="mobile">Mobile Number</label>
                  <input
                    type="text"
                    id="mobilenumber"
                    value={mobilenumber}
                    placeholder="Enter Mobile Number"
                    required
                    onChange={(e) => setMobilenumber(e.target.value)}
                  ></input>
                </div>
                <div>
                  <label htmlFor="birthdate">Birth Date </label>
                  <input
                    type="text"
                    id="birthdate"
                    value={birthdate}
                    placeholder="DD.MM.YYYY"
                    required
                    onChange={(e) => setBirthdate(e.target.value)}
                  ></input>
                </div>
                <div>
                  <label htmlFor="age">Age</label>
                  <input
                    type="text"
                    id="age"
                    value={age}
                    placeholder="Enter Age"
                    required
                    onChange={(e) => setAge(e.target.value)}
                  ></input>
                </div>
                <div>
                  <label htmlFor="idproof">Photo ID Proof</label>
                  <select
                    id="photoidproof"
                    value={photoidproof}
                    onChange={(e) => setphotoidproof(e.target.value)}
                  >
                    <option value="">Select Photo ID Document</option>
